import React,{useState} from 'react';
import {connect} from 'react-redux';
import TodoList from '../todo-list';


const All=({todos})=> {


    return(
        <div>
            <TodoList data={todos}/>
        </div>
    );
};


const mapStateToProps=(state) =>{
      const todos = state.todos;
      return {
        todos
      }
    }

export default connect(mapStateToProps)(All);
